import React, {useEffect, useState} from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedPlayer } ) {

    const [workoutCardList, setWorkoutCardList] = useState ("")

    useEffect(() => {
        fetch("http://localhost:9292/workouts")
        .then((res) => res.json())
        .then((data) => {
            setWorkoutCardList(data),
            workoutsToDisplay
        })
    }, [])


    const workoutsToDisplay = () => workoutCardList.map((workout) => <WorkoutCard key={workout.id} workout={workout} athlete={selectedPlayer}/>)

    return (
        <div>
            {workoutsToDisplay}
        </div>
    )
}

export default WorkoutList
